        prop.ros.remove()
    }
   
    return(
        <div  className="div-right"  style={{gridColumn:prop.column,gridRow:prop.rows}}>
            <div className="cart">
                <h1>{data}</h1>
                <div  className="mnue">
                    <ul>
                    {prop.res.map(function(item){
                        return <li>
                            {item} 
                            <button onClick={removes}>R</button>
                            </li>
                    })}
                    </ul>
                    
                   
                </div>
                
                <button type="button" className="confirm" >Confirm Order</button>
            </div>
        </div>
    );
}
